.accordion {

.accordion__button:hover {

.accordion__button:before {

    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {

}

.accordion__panel {

isconnected mode using product# search box\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then User enters Product# in Search box\r\n    Then Check for Catalog popup\r\n    Then Enter the Qty in the Product grid Case and Unit\r\n      |1|1|\r\n    Then Click on Next button\r\n    And Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMOrderComment\r\n  Scenario: For adding comment to order\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Enter Pro# in Quick Product Entry area\r\n    And Check for Case and Unit input box enabled or not based on that enter value\r\n      |1|1|\r\n    Then User should click on Comment icon in Order entry card\r\n    And User should enter comment in comment popup\r\n      |Comment at Order level|\r\n    Then Click on Next button\r\n    And Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMOrderCatalog\r\n  Scenario: For creating order using catalog\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products in disconnected mode\r\n      |1|1|\r\n    Then Click on Next button\r\n    And Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMQuickProduct\r\n  Scenario: To create Order in disconnected mode using Quick product\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode\r\n    Then User must click Start Order button\r\n    Then User User enters different Product# in Search bar and enter Qty by clicking image and click Delete product\r\n      |1|\r\n      |2|\r\n      |3|\r\n      |4|\r\n      |5|\r\n    Then User click on cart in catalog and click on Gotocart and select existing order\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button\r\n    Then Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMValidateShippingAddress\r\n  Scenario: Test scenario to validate whether default shipping address is selected or not in payment page\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode\r\n    Then User must click Start Order button\r\n    Then User should make selection between Pending order or Start New order\r\n    Then User should select Note from popup and Order guide from popup\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Enter Pro# in Quick Product Entry area\r\n    And Check for Case and Unit input box enabled or not based on that enter value\r\n      |1|1|\r\n    Then Click on Next button and validate shipping address\r\n    And Click on SubmitOrder button\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMCardViewOrder\r\n  Scenario: creation of order using card view from catalog page and create new order in Disconnected mode\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode and navigate to Catalog tab\r\n    And User should navigate to Catalog tab\r\n    And User should click on Reset filter button and all the products should displayed in Card view in Catalog page\r\n    Then User enters Product# in Search bar and enters Qty\r\n      |1|\r\n      |1|\r\n      |2|\r\n    Then User click on cart in catalog and click on Gotocart\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button\r\n    Then Click on SubmitOrder button for creating order from Catalog\r\n    Then User should be navigated to Order Entry page after creating order from catalog\r\n\r\n  @DMDeleteCardView\r\n  Scenario: Delete the product after adding it to cart,card view delete product in Disconnected mode\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode and navigate to Catalog tab\r\n    And User should navigate to Catalog tab\r\n    And User should click on Reset filter button and all the products should displayed in Card view in Catalog page\r\n    Then User enters Product# in Search bar and enter Qty and click on Delete button\r\n      |1|\r\n      |1|\r\n      |2|\r\n    Then User click on cart in catalog and click on Gotocart\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button\r\n    Then Click on SubmitOrder button for creating order from Catalog\r\n    Then User should be navigated to Order Entry page after creating order from catalog\r\n\r\n  @DMCreateOrderUsingListView\r\n  Scenario: Test scenario for creating order using List view in Disconnected mode\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode\r\n    And Then User selects Go offline option in Disconnected mode popup\r\n    Then User should get Customer account# popup\r\n    And User should select Customer Account# from popup and select the delivery date from popup wait till synchronized\r\n    Then User must be on Order Entry Page in disconnected mode and navigate to Catalog tab\r\n    And User should navigate to Catalog tab\r\n    And User should click on Reset filter button and all the products should displayed in List view in Catalog page\r\n    Then User enters Product# in Search bar and enters Qty for single Product in list view\r\n      |1|\r\n    Then User click on cart in catalog and click on Gotocart\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button\r\n    Then Click on SubmitOrder button for creating order from Catalog\r\n    Then User should be navigated to Order Entry page\r\n\r\n  @DMToConnected\r\n  Scenario: for Disconnected mode to connected mode\r\n    Given User should be in OE page in DM\r\n    When User clicks on network symbol and click on toggle button drop down should appear\r\n    And Then User should Click on toggle button to go online\r\n\r\n  @DMTwoCustomerTwoDeliveryDate\r\n  Scenario: Test scenario for selecting 2 customer accounts and 2 delivery date and navigate to connected mode\r\n    Given User should be in Order entry page\r\n    When User Clicks on network symbol and click on toggle button to navigate to disconnected mode
